        if dp[a][b]!= -1:
            return dp[a][b]

        for i in range(1, N + 1):
            if a == i or b == i:
                continue

            if (a, b) in islands or (b, a) in islands:
                dp[a][b] = True
                return True

            if helper(a, i) and helper(i, b):
                dp[a][b] = True
                return True

        dp[a][b] = False
        return False

    for i in range(1, N + 1):
        if helper(1, i):
            return 'POSSIBLE'
    return 'IMPOSSIBLE'

