    def find_max_num_layers(max_num_layers: int, remaining_mochis: List[int]) -> int:
        if len(remaining_mochis) == 1:
            # The remaining mochis just have the same diameter, so there is one layer.
            return 1

        num_layers: int = 1
        diameter_of_next_mochi: int = remaining_mochis[-1]
        for mochi in remaining_mochis[:-1]:
            if diameter_of_next_mochi > mochi:
                num_layers += 1
            else:
                break

        remaining_mochis = remaining_mochis[:-1]
        return find_max_num_layers(max_num_layers, remaining_mochis) + num_layers

    return str(find_max_num_layers(max_num_layers=number_of_mochis, remaining_mochis=mochi_diameters))

