    arr = [int(x) for x in stdin.split(" ")]
    arr.insert(0, 0)
    arr.append(0)
    arr = [0] + arr + [0]
    length = len(arr)
    memo = [[[0]*(length) for _ in range(length)] for _ in range(length)]

    def recur(idx, start, end, n):
        if idx == n:
            return 0
        if idx > n:
            return "impossible"
        if memo[start][end][idx]!= 0:
            return memo[start][end][idx]
        min_val = float('inf')
        for i in range(start, end+1):
            if arr[i] == arr[i+1]:
                min_val = min(min_val, recur(idx + 1, i + 1, end, n) + 1)
        memo[start][end][idx] = min_val
        return min_val

    ans = recur(1, 0, length - 2, n)
    if ans == "impossible":
        return ans
    else:
        return ans

