    def second_solution():
        """
        T(n) = O(n)
        """
        temp_list = temp[:]
        temp_list.sort()
        for i in range(1, n):
            if abs(temp_list[i] - temp_list[i-1]) <= abs(temp_list[i+1] - temp_list[i]):
                temp_list[i], temp_list[i-1] = temp_list[i-1], temp_list[i]
        return temp_list

