def solution(stdin: str) -> str:
    n = int(stdin)
    grid = [list(stdin.strip()) for _ in range(n)]
    rows, cols = len(grid), len(grid[0])

    # min_steps[i][j] is the minimum steps to reach cell (i, j)
    min_steps = [[0] * cols for _ in range(rows)]

    # Initialize min_steps
    for r in range(rows):
        for c in range(cols):
            if grid[r][c] == 'K':
                # We don't have any steps to reach the initial position
                min_steps[r][c] = -1
            elif grid[r][c] == '.':
                # We don't have any steps to reach the initial position
                min_steps[r][c] = -1
            else:
                min_steps[r][c] = float('inf')

    # We cannot reach the initial position
    if min_steps[0][0] == -1:
        return '-%d' % (min_steps[0][0])

    # We can reach the initial position from any other position
    for r in range(rows):
        for c in range(cols):
            if grid[r][c] == '.':
                # If the cell is unvisited, we can reach the initial position from there
                min_steps[r][c] = 1 + min_steps[r][c - 1] + min_steps[r - 1][c]
            elif grid[r][c] == 'K':
                # If the cell is blocked, we cannot reach the initial position from there
                min_steps[r][c] = -1

    # Find the position of the initial position in the sorted min_steps list
    r, c = 0, 0
    while r < rows and c < cols:
        if min_steps[r][c]!= -1:
            return '%d' % (min_steps[r][c])
        r += 1
        c += 1

    return '-%d' % (min_steps[r - 1][c - 1])

